const Nav = ({tabs}) => {
  return (
        <header>
            <a className="logo">Aero</a>
            <nav>
                <ul className="nav-links">
                    {tabs.map((tab) => (<li><a href="#">{tab.name}</a></li>))}
                </ul>
            </nav>
            <a className="sign-up-btn" href="#">Contact</a>
        </header>
  )
}

export default Nav
